void showList(int *a,int c)
{
  while(c--)
  {
    printf("%d ",*a);
    a++;
  }
  printf("\n");
}
void OptSSE(int *a, int *b)
{//add a and b 4 times and assign the values to a;
  asm("movdqu %0,%%xmm0"::"m"(*a));
  asm("paddq %0,%%xmm0"::"m"(*b));
  asm("movdqu %%xmm0,%0":"=m"(*a));
}
void ListAdder(int *a, int *b, int c)
{
  while(c--)
  {
    *a+=*b;
    a++;
    b++;
  }
}
void ListAdderOpt(int *a, int *b, int c)
{
  int c0 = c>>2;
  int c1 = c & 3;
  while(c0--)
  {
    OptSSE(a,b);
    a+=4;
    b+=4;
  }
  while(c1--)
  {
    *a+=*b;
    a++;
    b++;
  }
}
